set feedback off
set define off

prompt Creating ADDRESS...
create table ADDRESS
(
  addressid INTEGER not null,
  city      VARCHAR2(30) not null,
  street    VARCHAR2(30),
  country   VARCHAR2(30) not null
  );
alter table ADDRESS
  add primary key (ADDRESSID)
  using index;

prompt Creating AREASTUDY...
create table AREASTUDY
(
  areaname       VARCHAR2(30) not null,
  minpsychograde INTEGER not null
);
alter table AREASTUDY
  add primary key (AREANAME)
  using index;

prompt Creating BAGRUTSUBJECT...
create table BAGRUTSUBJECT
(
  bagrutid   INTEGER not null,
  bagrutname VARCHAR2(30) not null,
  units      INTEGER not null
);
alter table BAGRUTSUBJECT
  add primary key (BAGRUTID)
  using index;

prompt Creating ADMISSIONBAGRUT...
create table ADMISSIONBAGRUT
(
  bagrutid       INTEGER not null,
  areaname       VARCHAR2(30) not null,
  minbagrutgrade INTEGER not null
);
alter table ADMISSIONBAGRUT
  add primary key (AREANAME, BAGRUTID)
  using index;
alter table ADMISSIONBAGRUT
  add foreign key (AREANAME)
  references AREASTUDY (AREANAME);
alter table ADMISSIONBAGRUT
  add foreign key (BAGRUTID)
  references BAGRUTSUBJECT (BAGRUTID);

prompt Creating PERSON...
create table PERSON
(
  personid    VARCHAR2(9) not null,
  firstname   VARCHAR2(30) not null,
  lastname    VARCHAR2(30) not null,
  email       VARCHAR2(30) not null,
  birthdate   DATE not null,
  addressid   INTEGER not null,
  phonenumber VARCHAR2(30) not null
);
alter table PERSON
  add primary key (PERSONID)
  using index;
alter table PERSON
  add foreign key (ADDRESSID)
  references ADDRESS (ADDRESSID);

prompt Creating COUNSELOR...
create table COUNSELOR
(
  personid      VARCHAR2(9) not null,
  areaname      VARCHAR2(30) not null,
  licensenumber INTEGER not null
);
alter table COUNSELOR
  add primary key (PERSONID)
  using index;
alter table COUNSELOR
  add foreign key (AREANAME)
  references AREASTUDY (AREANAME);
alter table COUNSELOR
  add foreign key (PERSONID)
  references PERSON (PERSONID);

prompt Creating INTERESTED...
create table INTERESTED
(
  personid_ VARCHAR2(9) not null
);
alter table INTERESTED
  add primary key (PERSONID_)
  using index;
alter table INTERESTED
  add foreign key (PERSONID_)
  references PERSON (PERSONID);

prompt Creating INTERESTEDOF...
create table INTERESTEDOF
(
  personid VARCHAR2(9) not null,
  areaname VARCHAR2(30) not null
);
alter table INTERESTEDOF
  add primary key (PERSONID, AREANAME)
  using index;
alter table INTERESTEDOF
  add foreign key (PERSONID)
  references INTERESTED (PERSONID_);
alter table INTERESTEDOF
  add foreign key (AREANAME)
  references AREASTUDY (AREANAME);

prompt Creating MEETING...
create table MEETING
(
  personid    VARCHAR2(9) not null,
  counselorid VARCHAR2(9) not null,
  meetdate    TIMESTAMP(6) not null
);
alter table MEETING
  add primary key (MEETDATE, PERSONID, COUNSELORID)
  using index;
alter table MEETING
  add foreign key (PERSONID)
  references INTERESTED (PERSONID_);
alter table MEETING
  add foreign key (COUNSELORID)
  references COUNSELOR (PERSONID);

prompt Creating PSYCHOMETRIC...
create table PSYCHOMETRIC
(
  personid    VARCHAR2(9) not null,
  psychodate  DATE not null,
  psychograde INTEGER not null
);
alter table PSYCHOMETRIC
  add primary key (PSYCHODATE, PERSONID)
  using index;
alter table PSYCHOMETRIC
  add foreign key (PERSONID)
  references INTERESTED (PERSONID_);

prompt Creating TESTED...
create table TESTED
(
  personid VARCHAR2(9) not null,
  bagrutid INTEGER not null,
  grade    INTEGER not null
);
alter table TESTED
  add primary key (PERSONID, BAGRUTID)
  using index;
alter table TESTED
  add foreign key (PERSONID)
  references INTERESTED (PERSONID_);
alter table TESTED
  add foreign key (BAGRUTID)
  references BAGRUTSUBJECT (BAGRUTID);

